  false,\n\t\"url\": null,\n\t\"notes\": \"The Oahu, Hawaii Elevation Data Task Order
  involves collecting and delivering topographic elevation point data derived from
  multiple return light detection and ranging (LiDAR) measurements on the island of
  Oahu in Hawaii. The Statement of Work (SOW) for the area covering the northern 2/3
  of Oahu was developed by the National Oceanic and Atmospheric Administration's (NOAA)
  Office for Coastal Management. A separate but related task order was issued by the
  USGS National Geospatial Technical Operations Center (NGTOC), under their Geospatial
  Products and Services Contract (GPSC), to leverage the same resources committed
  to the NOAA LiDAR project for the acquisition of LiDAR data in the southern 1/3
  portion of Oahu. The combined task orders yielded one study area covering the entire
  island of Oahu. The data collected for the island of Oahu will exhibit Hydro Flattened
  DEMs for inclusion into the NED. The purpose of the data is for use in coastal management
  decision making, including applications such as flood plain mapping and water rights
  management. The point density for this data set was specified in the SOW at 1.15
  pts/m2. The NOAA Office for Coastal Management tested the NPS (nominal pulse spacing)
  for this data set in April 2015. The NPS was determined to be 0.84 m. The data used
  in the NPS determination were the first returns of classes 1,2,9, and 10.\",\n\t\"owner_org\":
